import React, {useState} from "react"

import Navbar from './componenets/Navbar'
import MainContent from "./componenets/MainContent";
import './App.css'
import NavItem from "./componenets/NavItem"


export default function App() {

  const [isHome , changeIsHome] = useState(true)
  const { data } = require('./data')
  console.log(isHome)

  function toggleIsHome(){
    changeIsHome(prevIsHome => !prevIsHome)
  }

  return (
    <>
      <Navbar />
      <div className="container">
        {isHome ? <MainContent data={data} toggle={toggleIsHome} /> : <NavItem data={data} toggle={toggleIsHome}/>}
      </div>
    </>
  );
}
